description.text:
Designed to fit the upper &quot;card holder&quot; slots in a VW Tiguan. This is 1/2 of a ball-joint mounting fixture for a universal phone mount.  
This design has not yet been tested. I'm not entirely certian I've got the dimensions correct.  
There are 3 stl files. which are variations on length of the inserts and depth of the &quot;front panel&quot;
